import React, { Component } from 'react';
import './App.css';
const Clarifai = require('clarifai');

class App extends Component {

  componentDidMount() {
    const app = new Clarifai.App({apiKey: 'bd8644854b19417dacdfa3adba21aab1'});
    app.models.predict("eeed0b6733a644cea07cf4c60f87ebb7", "https://samples.clarifai.com/metro-north.jpg")
    .then(res => {
      console.log(res);
    },
    err => {
      console.log(err);
    }
  );
  }

  render() {
    return (
      <div className="App">
        Hello!
      </div>
    );
  }
}

export default App;
